import closeUrl from '../../images/close.svg'
import './diolog.scss';

class StDiolog extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
          showDetailFlag: this.props,   // 默认不显示
        };
    }

    render() {
        <div className={showDetailFlag}>
            <div className="mask">
                <div className="diolog">
                        <div className="diolog-title">
                            <span>温馨提示</span>
                            <img src={closeUrl} />
                        </div>
                        <div className="content">
                            <span>该操作需要较长的时间，是否继续？期间可点击【取消同步】按钮取消同步</span>    
                            <button>继续</button>         
                        </div>
                    </div> 
            </div>
        </div>
    }
}
